SELECT DISTINCT flight_id FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code AND airport_service_1.city_code = 'DENVER' AND airport_service_1.city_name = 'DENVER' , airport_service airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code AND airport_service_2.city_code = 'PITTSBURGH' AND airport_service_2.city_name = 'PITTSBURGH' ORDER BY flight_1.price ASC LIMIT 1
SELECT DISTINCT flight.flight_id FROM flight , airport_service airport_service ON flight.from_airport = airport_service.airport_code , city ON airport_service.city_code = city.city_code WHERE flight.departure_time BETWEEN 1800 AND 2200 AND flight.route = 'BOeing 767'
SELECT DISTINCT flight_id FROM flight flight_1 , airport_service airport_service_1 ON flight_1.from_airport = airport_service_1.airport_code , city city_1 ON airport_service_1.city_code = city_1.city_code , airport_service airport_service_2 ON flight_1.to_airport = airport_service_2.airport_code , city city_2 ON airport_service_2.city_code = city_2.city_code WHERE flight_1.departure_time BETWEEN 1800 AND 2200
SELECT DISTINCT flight_id FROM flight flight WHERE departure_time < '12:00:00' AND from_airport = 'DALLAS' AND to_airport = 'OAKLAND'
